import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';

const selectStyle = makeStyles({
    root: {
        width: '100%',
      fontSize: '15px',
      color: '#222b45',
      fontWeight: '600',
      paddingTop: '14px',
      paddingBottom: '14px',
      border: '1px solid #c5cee0',
      backgroundColor: '#f7f9fc',
      boxSizing: 'border-box',
    },
});

export default function TransInfo () {
    const classes = selectStyle();
    const [CountryCode, setCountryCode] = React.useState('');
    const handleChange = (event) => {
      setCountryCode(event.target.value);
    };
    return (
        <React.Fragment>
            <Grid container spacing={4}>
                <Grid item xs={12} sm={6}>
                    <FormControl variant="outlined" fullWidth>
                        <Select labelId="country-code-label" id="country-code" 
                        value={CountryCode} onChange={handleChange} displayEmpty 
                        inputProps={{ 'aria-label': 'Without label' }}
                        classes={{ root: classes.root, }}>
                            <MenuItem value="" disabled>Select</MenuItem>
                            <MenuItem value={1}>BTC</MenuItem>
                            <MenuItem value={2}>ETH</MenuItem>
                        </Select>
                    </FormControl>
                </Grid>
            </Grid>
            <Grid container spacing={4}>
                <Grid item xs={12} sm={6}>
                    <TextField
                        required
                        id="amount"
                        name="amount"
                        fullWidth
                        placeholder="ex: 0.347895"
                    />
                </Grid>
            </Grid>
        </React.Fragment>
    );
}
